import React from 'react';
import 'App.css';

class Board extends React.Component {
  render() {
    return(
      <div className="board-wrap">
        <div className="board-list">
          <div class="board-list-head-wrap">
            <ul class="board-list-head">
              <li class="board-list-title board-list-head">name</li>
              <li class="board-list-title board-list-head">rank</li>
              <li class="board-list-title board-list-head">department</li>
              <li class="board-list-title board-list-head"></li>
            </ul>
          </div>
        </div>
      </div>
    );
  }
}

export default Board;
